import React, { Component } from 'react'

export class Home extends Component {
  render() {
    return (
      <div className="home-content">
            <h1>Welcome To Github Users Engine</h1>
            <p>thanks to this app you can display all users from github app 
              with the possibility to search for a specific user or users</p>
            <p>So what are you waiting for ! <a className='btn btn-primary' href="">Click here</a> to display all users 
                or <a className='btn btn-primary' href="">Click here</a> to search for a specific user</p>
      </div>    
    )
  }
}

export default Home
